  false,\n\t\"url\": null,\n\t\"notes\": \"The Chautauqua National Wildlife Refuge
  Sign Plan explains how signs are used on the Refuge to help guide and educate visitors.
  An inventory of current signs is given as well as a list of sign needs. The following
  types of signs are discussed: entrance sign, area management signs, information
  signs, guide signs, interpretive signs, traffic control devices, federal recreation
  symbols, safety instruction signs, service emblem, and decals. Photographs, sign
  diagrams, and maps are included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
